import React from "react";
import cl from "./Media.module.css"


export const Media=()=>{ 

    return( 
        <div className={cl.main}>
           <div className={cl.block}>
            <div className={cl.headlight}>
                 <h3 className={cl.text1}>Самые популярные вопросы </h3><h3 className={cl.text2}>о запчастях</h3>

            </div>
            </div>

        </div> 
    )
}
